import React, { useState } from 'react';

const App=()=>{
    const [number,setNumber]=useState("3");
let count=0;
    const incNumber=()=>{
        count++;
    }
    return(
        <>
<h1>{setNumber}</h1>
<button onClick={incNumber}>Click me</button>
        </>
    )
}

export default App;
